import { getByDisplayValue } from "@testing-library/react";
import React from "react";

function ext() {
  return <div className="itemsub">Exterior(9)</div>;
}
function int() {
  return <div className="itemsub">Interior(10)</div>;
}
function all() {
  return (
    <a href="#">
      <div className="All">All Photos(30)</div>
    </a>
  );
}

function Card(props) {
  return (
    <div className={"cssbox item" + props.no}>
      {props.no == 2 ? ext() : ""}
      {props.no == 6 ? int() : ""}
      {props.no == 9 ? all() : ""}

      <a id={"image" + props.no} href={"#image" + props.no}>
        <img
          className={
            "cssbox_thumb " +
            (props.no === 1 ? "fimg " : "img ") +
            ((props.no > 5 && props.no < 10) || props.no > 13
              ? "hidden "
              : " ") +
            (props.no === 1 ? "fimg " : "img ") +
            (props.no === 9 ? "All" : "")
          }
          src={props.address}
        />
        <span className="cssbox_full">
          <nav class="navbar navbar-expand-lg navbar-dark ">
            <a style={{ color: "grey" }} class="navbar-brand" href="#">
              All Photos(50)
            </a>
            <div class="collapse navbar-collapse" id="navbarNav">
              <ul class="navbar-nav">
                <li class="nav-item active">
                  <a class="nav-link" href="#image1">
                    Exterior <span class="sr-only">(current)</span>
                  </a>
                </li>
                <li class="nav-item">
                  <a style={{ color: "grey" }} class="nav-link" href="#image10">
                    Interior
                  </a>
                </li>
                <li class="nav-item">
                  <a style={{ color: "grey" }} class="nav-link" href="#image20">
                    Mechanical
                  </a>
                </li>
                <li class="nav-item">
                  <a
                    style={{ color: "grey" }}
                    class="nav-link disabled"
                    href="#image32"
                  >
                    Docs
                  </a>
                </li>
                <li class="nav-item">
                  <a
                    style={{ color: "grey" }}
                    class="nav-link disabled"
                    href="#image33"
                  >
                    Others
                  </a>
                </li>
              </ul>
            </div>
          </nav>
          <img className={"image" + props.no} src={props.address} />
        </span>
      </a>
      <a class="cssbox_close" href="#void"></a>
      <a class="cssbox_prev" href={"#image" + (+props.no - 1)}>
        &lt;
      </a>
      <a class="cssbox_next" href={"#image" + (+props.no + 1)}>
        &gt;
      </a>
    </div>
  );
}

export default Card;
